import React from 'react';

import './App.css';
import FetchAll from './components/FetchAll';
import FetchFirstRoute from './components/FetchFirstRoute';

function App() {
  return (
    <>
    <div className="app">
      <h1>hitting our first / route</h1>
      <FetchFirstRoute/>
    </div>
      <div className="app">
        <h1>See all Gundams!</h1>
        <FetchAll />
    </div>
      <div className="app">
        <h1>Get a Single Gundam</h1>
        <Fetch />
    </div>
    </>
  );
}

export default App;
